import React, { useState } from 'react';
import emailjs from 'emailjs-com';

// Define styles within the same file
const styles = {
  container: {
    padding: '4rem 1rem',
    maxWidth: '800px',
    margin: '0 auto',
  },
  heading: {
    color: '#333',
    fontWeight: '700',
    fontSize: '2.5rem',
    marginBottom: '1rem',
  },
  formWrapper: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#f0f4f8',
    borderRadius: '8px',
    padding: '2rem',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  inputField: {
    marginBottom: '1rem',
    padding: '0.75rem',
    borderRadius: '4px',
    border: '1px solid #ddd',
    width: '100%',
    boxSizing: 'border-box',
    outline: 'none',
    fontSize: '1rem',
  },
  textarea: {
    marginBottom: '1rem',
    padding: '0.75rem',
    borderRadius: '4px',
    border: '1px solid #ddd',
    width: '100%',
    boxSizing: 'border-box',
    outline: 'none',
    fontSize: '1rem',
    resize: 'vertical',
  },
  button: {
    padding: '0.75rem',
    borderRadius: '4px',
    backgroundColor: '#4a90e2',
    color: '#fff',
    border: 'none',
    width: '100%',
    fontSize: '1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  buttonHover: {
    backgroundColor: '#357ABD',
  },
  alert: {
    padding: '1rem',
    borderRadius: '4px',
    backgroundColor: '#dff0d8',
    color: '#3c763d',
    marginBottom: '1rem',
  },
  alertError: {
    backgroundColor: '#f2dede',
    color: '#a94442',
  }
};

const Contact = () => {
  // State to hold form data
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  // State for alerts
  const [alert, setAlert] = useState('');

  // Function to handle input change
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  // Function to send email
  const sendEmail = async (e) => {
    e.preventDefault(); // Prevent default form submission

    try {
      // Use EmailJS to send email
      await emailjs.send(
        'service_bwhv55s',  // Replace with your actual EmailJS Service ID
        'template_b8zkcmg', // Replace with your actual EmailJS Template ID
        formData,          // Form data containing name, email, subject, and message
        'yJBCEfYLLYyRuMnFo'      // Replace with your actual EmailJS User ID
      );
      setAlert('Message sent successfully!');
    } catch (error) {
      setAlert('An error occurred, please try again.');
      console.error('EmailJS Error:', error); // Log the error for debugging
    }

    // Reset the form after submission
    setFormData({
      name: '',
      email: '',
      subject: '',
      message: ''
    });
  };

  return (
    <section id="contact" style={styles.container}>
      <h2 style={styles.heading}>Get In Touch</h2>
      {alert && (
        <div style={{ ...styles.alert, ...(alert.includes('error') ? styles.alertError : {}) }}>
          {alert}
        </div>
      )}
      <div className='md:flex justify-between items-center'>
        <div className='w-full mt-8 md:mt-0 md:w-1/2 sm:h-[450px] lg:flex items-center'>
          <form style={styles.formWrapper} onSubmit={sendEmail}>
            <input
              type="text"
              name="name"
              placeholder='Enter Your Name'
              value={formData.name}
              onChange={handleInputChange}
              style={styles.inputField}
              required
            />
            <input
              type="email"
              name="email"
              placeholder='Enter Your Email'
              value={formData.email}
              onChange={handleInputChange}
              style={styles.inputField}
              required
            />
            <input
              type="text"
              name="subject"
              placeholder='Subject'
              value={formData.subject}
              onChange={handleInputChange}
              style={styles.inputField}
              required
            />
            <textarea
              name="message"
              rows={4}
              placeholder='Write your Message'
              value={formData.message}
              onChange={handleInputChange}
              style={styles.textarea}
              required
            />
            <button
              type="submit"
              style={styles.button}
              onMouseEnter={(e) => e.target.style.backgroundColor = styles.buttonHover.backgroundColor}
              onMouseLeave={(e) => e.target.style.backgroundColor = styles.button.backgroundColor}
            >
              Send Message
            </button>
          </form>
        </div>
      </div>
    </section>
  );
};

export default Contact;
